    <script>
        \$(document).ready(function(){

            \$(\".js-source-states-2\").select2();

            /* BOOTSTRAP SLIDER */
            \$('.slider').slider();

            // Datepicker
            \$('#fechaExcepcion').datepicker({
                format: \"yyyy-mm-dd\",
                autoclose: true
            });

            //update cache values

            \$('#cache').on('slide',function(e){
                //separar los valores
                var values=e.value.toString();
                values= values.split(',');
                \$('#cacheMin').text(values[0]);
                \$('#cacheMax').text(values[1]);
            });

            \$('#aforo').on('slide',function(e){

                \$('#aforoMinimo').text(e.value);

            });

            \$('#medidasEscenario').on('slide',function(e){

                \$('#medidasMin').text(e.value);

            });

            /* initialize the calendar
             -----------------------------------------------------------------*/
            var sessionId=\$('#sessionId').val();
            var urlJson=\$('#urlJSonEvents').val();

            cleanCalendar('#mycanlendar');

            initCalendar('#mycalendar',urlJson);

            //Accion del boton Atras

            \$('.btn-back-local').on('click',function(e){
                e.preventDefault();

                wait('.container');

                var step=\$(this).attr('data-step');

                //ocultar la region actual

                if(step>1){
                    var regionActual=\"#step-\"+step+\"-container\";

                    \$(regionActual).hide();

                    var newStep=step-1;

                    var regionAnterior=\"#step-\"+newStep+\"-container\";

                    \$(regionAnterior).fadeIn();

                    //actualizar los items del listado de steps

                    updateItems(newStep);
                }

                endWait('.container');
            });


            //Action del boton submit de los forms

            \$('.btn-submit-local').on('click',function(e){
                e.preventDefault();

                var step=\$(this).attr('data-step');
                var validator=null;
                if(step==1){
                    validator=validator1;
                }
                else if(step==2){
                    validator=validator2;
                }
                else if(step==3){
                    validator=validator3;
                }
                else if(step==4){
/*  No se envia ningun form, solo se envia la peticion directo al server para 
 *  terminar el registro de local y redireccionar */
                    \$.ajax(\"/registro/local\",{
                        type:'post',
                        dataType:'json',
                        data:{
                            'step':4
                        }
                    }).done(function(){
                        var nextStep=response[1];

                        if(nextStep==-1){
                            //TODO:fin del Wizard, redireccionar para el area de cliente
                            alert('Fin del Wizard, redireccionamos para el area de cliente, cuando este lista ;)');
                        }
                    });
                }
                //validaar primero el form
                if(validator!=null && validator.form()){
                    wait('.container');
                    var selector=\"#step-\"+step+\"-form\";
                    var \$form=\$(selector);
                    //limpiar todos los errores
                    \$('.form-error').remove();
                    //procesar el form
                    \$.ajax(\$form.attr('action'),{
                        dataType:\"json\",
                        type:\"post\",
                        data:\$form.serialize()
                    }).done(function(response){
                        if(!response[0]){
                            if(response[1]=='not_loguedin'){
                                window.location.replace(\$('#login_url').val());
                            }
                            //buscar los errores y posicionarlos en los campos correspondientes
                            var errores=response[1];
                            for(var i=0;i<=errores.length;i++){
                                var sel=\"#\"+errores[i]['id'];
                                var error='<span class=\"error\" style=\"color:red;font-weight: bold;\">'+errores[i]['error']+'</span>';
                                \$(sel).closest('form').find(\"label[for='\" + \$(sel).attr( \"id\" ) + \"']\").append(\$(error));
                            }
                        }
                        else{ //obtener el paso siguiente
                            var nextStep=response[1];
                            if(nextStep==-1){
                                //TODO:fin del Wizard, redireccionar para el area de cliente
                                alert('Fin del Wizard, redireccionamos para el area de cliente, cuando este lista ;)');
                            }
                            else{
                                var stepContainer=\"#step-\"+step+\"-container\";
                                \$(stepContainer).hide();
                                var stepContainer=\"#step-\"+nextStep+\"-container\";
                                \$(stepContainer).fadeIn();
                                //marcar el item de la lista de steps
                                updateItems(nextStep);
                                jQuery('html, body').animate({
                                    scrollTop: jQuery('div.container').offset().top - 50
                                }, 1500);
                            }
                        }
                    });
                    endWait('.container');
                }
            });
        });

        function updateItems(nextStep){
            \$('ul.steps > li').each(function(){
                \$(this).removeClass('active');
            });
            var selectorStep=\"ul.steps > li#step-\"+nextStep;
            \$(selectorStep).addClass('active');
        }
    </script>

    
